import React from 'react'

const lotery = (props) => {
  return (
    <div>
    <div>{props.sum}</div>
    <div>{props.sumType}</div>
    <div>{props.num1}</div>
    <div>{props.num2}</div>
    <img src={props.addition}></img>
  </div>
  )
}
export default lotery;
